import React from "react";
import Section from "./Section";

const Footer = (props) => (
  <Section>
    <div>
        <hr />
        <div className="footer-links">
            <p>Blog</p>
            <p>Projects</p>
            <p>Media</p>
            <p>Contact</p>
        </div>
    </div>
  </Section>
);

export default Footer;
